import React, { Component } from 'react'

class CreateEvent extends Component {
    render() {
        return (
            <div className="container">
                <input className="form-control" type="text" placeholder="Event Name" aria-label="default input example"/>
                <input className="form-control" type="text" placeholder="Enter Date(DD/MM/YY)" aria-label="default input example"/>


            </div>
        )
    }
}
export default CreateEvent;
